pragma solidity >=0.4.21 <0.7.0;

contract Test {
  address public owner;
  uint public startTime;

  constructor() public {
    owner = msg.sender;
  }

  function tmp() public view returns(int){
    require(startTime != 0);
    return int((120 seconds)-(now - startTime));
  }

  function callThisToStart() public {
    startTime = now;
  }

  function callThisToStop() public {
    startTime = 0;
  }

  function doSomething() public view returns (int){
    return tmp();
  }

}
